import logo from '../../assets/logo.png'
import "./index.css";
export default function index() {
   
    return (
        <div className="top-parent">
            <div className="first-child">
                <h3>DigiCollect</h3>
             <img src={logo} alt="image"/>
            </div>
            <div className="second-child">

            </div>
            <div className="third-child">

            </div>
        </div>
    );
  }
